(40, 'organizational_structure', '{\"en\":\"Organizational structure\",\"ar\":\"الهيكل التنظيمي\"}', '{\"en\":\"<p>Under construction<\\/p>\",\"ar\":\"<p>&middot; رئيس لجنة ادارة المركز: السيد الاستاذ الدكتور ناصر الجيزاوي رئيس الجامعة<\\/p>\\r\\n<p>&middot; نائب رئيس لجنة ادارة المركز: السيد الاستاذ الدكتور تامر سمير نائب رئيس الجامعة لشؤن التعليم والطلاب<\\/p>\\r\\n<p>&middot; المشرف علي المركز: الاستاذ الدكتور اشرف اسماعيل المشد<\\/p>\"}', 1, '2024-03-09 15:24:43', '2024-09-05 06:53:49'),
(50, 'contact', '{\"en\":\"Contact\",\"ar\":\"اتصل بنا\"}', '{\"en\":\"<!-- Contact Section -->\\r\\n<section id=\\\"contact\\\" class=\\\"contact section\\\">\\r\\n<div class=\\\"mb-5\\\" data-aos=\\\"fade-up\\\" data-aos-delay=\\\"200\\\"><iframe style=\\\"border: 0; width: 100%; height: 300px;\\\" src=\\\"https:\\/\\/www.google.com\\/maps\\/embed?pb=!1m14!1m8!1m3!1d13755.049920735857!2d31.1816293!3d30.471165!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xfcf504d1b4fd19b3!2z2KzYp9mF2LnYqSDYqNmG2YfYpw!5e0!3m2!1sar!2seg!4v1477295444689\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\" loading=\\\"lazy\\\" referrerpolicy=\\\"no-referrer-when-downgrade\\\"><\\/iframe><\\/div>\\r\\n<!-- End Google Maps -->\\r\\n<div class=\\\"container\\\" data-aos=\\\"fade-up\\\" data-aos-delay=\\\"100\\\">\\r\\n<div class=\\\"row gy-4\\\">\\r\\n<div class=\\\"col-lg-4\\\"><!-- End Contact Form --><\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/section>\\r\\n<!-- \\/Contact Section -->\",\"ar\":\"<!-- Contact Section -->\\r\\n<section id=\\\"contact\\\" class=\\\"contact section\\\">\\r\\n<div class=\\\"mb-5\\\" data-aos=\\\"fade-up\\\" data-aos-delay=\\\"200\\\"><iframe style=\\\"border: 0; width: 100%; height: 300px;\\\" src=\\\"https:\\/\\/www.google.com\\/maps\\/embed?pb=!1m14!1m8!1m3!1d13755.049920735857!2d31.1816293!3d30.471165!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xfcf504d1b4fd19b3!2z2KzYp9mF2LnYqSDYqNmG2YfYpw!5e0!3m2!1sar!2seg!4v1477295444689\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\" loading=\\\"lazy\\\" referrerpolicy=\\\"no-referrer-when-downgrade\\\"><\\/iframe><\\/div>\\r\\n<!-- End Google Maps -->\\r\\n<div class=\\\"container\\\" data-aos=\\\"fade-up\\\" data-aos-delay=\\\"100\\\">\\r\\n<div class=\\\"row gy-12\\\">\\r\\n<div class=\\\"col-lg-12\\\"><!-- End Contact Form --><\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/section>\\r\\n<!-- \\/Contact Section -->\"}', 1, '2024-03-09 15:33:16', '2024-06-24 07:33:51'),
(52, 'aims_vision_mission', '{\"en\":\"Vision and Aims\",\"ar\":\"الرؤية والأهداف\"}', '{\"en\":\"<h3>Aims<\\/h3>\\r\\n<div class=\\\"row\\\">\\r\\n<div class=\\\"col-md-12\\\">\\r\\n<div class=\\\"headline\\\">\\r\\n<h1 class=\\\"pagetitle\\\"><\\/h1>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<p>Internationalization, Assistance, Cooperation &ndash; These are both our aims and our challenges: We widen and deepen the international network of our university, we care for students and scientists going abroad or coming to BU, we support international joint projects in teaching, studies and research. Welcome at the International Relations Office Our commitment to internationalisation results from our ambition to achieve and maintain world-class quality in all that we do. Our goal is to provide all of our students, domestic and international, with a truly international experience either at Egypt or through one of our partners. The outcome of our strategy is best reflected by our graduates who we expect are well-prepared to make a difference in a globalised world.<\\/p>\\r\\n<p><\\/p>\\r\\n<h3>Vision<\\/h3>\\r\\n<p>IRO is looking forward to activating the role of Benha University among the international institutions.<\\/p>\\r\\n<p><\\/p>\\r\\n<h3>Mission<\\/h3>\\r\\n<div class=\\\"row\\\">\\r\\n<div class=\\\"col-md-12\\\">\\r\\n<div class=\\\"headline\\\">\\r\\n<h1 class=\\\"pagetitle\\\"><\\/h1>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<p>The International Relations Office IRO is dedicated to enhancing a vibrant international community and to fostering cross-cultural experience. We welcome, support and strengthen diversity through advocacy and holistic service. Enriching connections is our goal.<\\/p>\",\"ar\":\"<h3 class=\\\"selectable-text copyable-text x15bjb6t x1n2onr6\\\" dir=\\\"rtl\\\"><span class=\\\"selectable-text copyable-text\\\" style=\\\"white-space: pre-wrap;\\\">الرؤية<\\/span><\\/h3>\\r\\n<p class=\\\"selectable-text copyable-text x15bjb6t x1n2onr6\\\" dir=\\\"rtl\\\"><span>تحسين الرعاية الصحية للمرضى من خلال التعليم الطبي القائم على المحاكاة.<\\/span><\\/p>\\r\\n<p class=\\\"selectable-text copyable-text x15bjb6t x1n2onr6\\\" dir=\\\"rtl\\\"><span class=\\\"selectable-text copyable-text\\\" style=\\\"white-space: pre-wrap;\\\"><\\/span><\\/p>\\r\\n<h3 class=\\\"selectable-text copyable-text x15bjb6t x1n2onr6\\\" dir=\\\"rtl\\\"><span class=\\\"selectable-text copyable-text\\\" style=\\\"white-space: pre-wrap;\\\">الأهداف<\\/span><\\/h3>\\r\\n<p class=\\\"selectable-text copyable-text x15bjb6t x1n2onr6\\\" dir=\\\"rtl\\\"><span>تقديم تعليم طبي مبتكر عالي الجودة يعتمد على المحاكاة مما يسمح للطبيب باكتساب المهارات قبل العمل على شخص حي.<\\/span><\\/p>\"}', 1, '2024-04-09 18:42:10', '2024-09-30 06:01:50'),
(62, 'about', '{\"en\":\"about\",\"ar\":\"عن المركز\"}', '{\"en\":\"<p>Under construction<\\/p>\",\"ar\":\"<p>تم افتتاح مركز المهارات والمحاكاة الطبية بجامعة بنها في سبتمبر 2022 بتشريف معالي الاستاذ الدكتور وزير التعليم العالي والبحث العلمي ومعالي محافظ القليوبية ومعالي رئيس الجامعة ومعالي نواب رئيس الجامعة وشركاء النجاح من السادة المسؤولين بالبنك الاهلي المصري (بنك اهل مصر) ولفيف من الضيوف<\\/p>\\r\\n<p>ويعد المركز احد مخرجات الشراكة الاستراتيجية الناجحة مع البنك الاهلي المصري (بنك اهل مصر)<\\/p>\\r\\n<p>ويقع مركز المهارات و المحاكاة الطبية في طابق منفصل اعلي المكتبة المركزية بجامعة بنها على مساحة 2000 متر مربع تقريبا.<\\/p>\\r\\n<p><\\/p>\\r\\n<p><\\/p>\\r\\n<p>مركز المهارات والمحاكاة الطبية بجامعة بنها: هو مركز تعليمي طبي قائم علي المحاكاة<\\/p>\\r\\n<p><\\/p>\\r\\n<p>&middot; يسمح للمتدرب باكتساب المهارات الطبية قبل الممارسة الاكلينيكية على المرضي<\\/p>\\r\\n<p>&middot; يسمح باكتساب مهارات التعامل الطبي في الرعاية الحرجة مثل كيفية التعامل مع مجرى الهواء والإنعاش القلبي الرئوي والصدمات الكهربائية للقلب والكوارث الطبية حيث يمكن أن يؤدي خطأ بسيط الي حدوث الوفاة.<\\/p>\\r\\n<p>&middot; يساعد على زيادة السرعة والكفاءة والتلقائية والدقة في التشخيص والعلاج في العديد من التخصصات الطبية<\\/p>\"}', 1, '2024-06-24 07:21:51', '2024-09-30 05:56:39'),
(63, 'services', '{\"en\":\"services\",\"ar\":\"الخدمات\"}', '{\"en\":\"<p>under construction<\\/p>\",\"ar\":\"<p>تحت الإنشاء<\\/p>\"}', 1, '2024-06-24 07:27:18', '2024-06-24 07:27:18'),
(64, 'courses&workshops', '{\"en\":\"Courses and Workshops\",\"ar\":\"الدورات والورش\"}', '{\"en\":\"<p>Under construction<\\/p>\",\"ar\":\"<p>الدورات التدريبيه وورش العمل التي تم تنظيمها بمركزالمهارات والمحاكاة الطبيه بجامعة بنها<\\/p>\\r\\n<p><\\/p>\\r\\n<p><\\/p>\\r\\n<p>1- ورشه عمل عن (الجديد في الموجات فوق الصونية والدويلر في مجال امراض النساء والتوليد) يومي الثلاثاء والاربعاء (4 &ndash; 5) سيتمبر 2023:<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تمت بنجاح كبير ورشه عمل عن (الجديد في الموجات فوق الصونية والدويلر في مجال امراض النساء والتوليد) بمركز المهارات والمحاكاة الطبية بالتعاون مع قسم أمراض النساء و التوليد بجامعه بنها تحت مظله جامعه بنها و رعاية معالي الاستاذ الدكتور ناصر الجيزاوي رئيس الجامعة و معالي الاستاذ الدكتور تامر سمير نائب رئيس الجامعة لشؤن التعليم والطلا ب و بمشاركة خبراء وقامات فى مجال الموجات فوق الصوتيه والدوبلر من الجامعات المصريه المختلفة (جامعة القاهرة - جامعة الازهر &ndash; جامعة المنصورة &ndash; جامعة الزقازيق &ndash; جامعة المنوفيه &ndash; جامعة مصر للعلوم والتكنولوجيا) بالضافة لخبراء وقامات فى مجال الموجات فوق الصوتيه والدوبلر من جامعة بنها و التى استهدفت أطباء النساء و التوليد ( نواب _ دراسات عليا_ زمالة مصري<\\/p>\\r\\n<p><\\/p>\\r\\n<p>و ذلك فى حضور الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنهفي اليوم الاول و الاستاذ الدكتور\\/ تامر سمير نائب رئيس جامعة لشؤن التعليم والطلا ب في اليوم الثاني<\\/p>\\r\\n<p>و تميزت ورشه العمل بالآتى<\\/p>\\r\\n<p>فريق عمل و تدريب على أعلى مستوى<\\/p>\\r\\n<p>احدث اجهزه السونار من الفئات العالية و التى وفرها قسم امراض النساء و التوليد و مركز المهارات و المحاكاه الطبيه بجامعه بنها بالتعاون مع شركة ميندراى الرائده فى مجال السونار وذلك ليتيح للمشتركين التدرب على احدث التقنيات الطبية فى مجال السونار و ضمانا لجوده عاليه من التدريب<\\/p>\\r\\n<p><\\/p>\\r\\n<p>و تم التدريب على المرضي ( بعد اخد موافقة من المرضي) مما يعطى بعد شامل لمفهوم التدريب الطبى و يضمن للمشترك تحقيق الاستفادة القصوى<\\/p>\\r\\n<p>التى يمتلكها مركز المهارات و التى تتيح التدريب عن طريق للمجموعات الصغيره قاعات التدريب<\\/p>\\r\\n<p>Small group Learning<\\/p>\\r\\n<p>و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>الشهادات المعتمده من جامعه بنها التى يحصل عليها المتدربين و تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p>حضر الورشه 80 طبيب متخصص فى مجال النساء و التوليد ( حضور علمى) و تم تدريب 35 طبيب ( المسجلين للتدريب العملى)<\\/p>\\r\\n<p><\\/p>\\r\\n<p><\\/p>\\r\\n<p><\\/p>\\r\\n<p>2- ورشه عمل عن الجديد في جراحه المناظير النسائيه بالتعاون مع قسم امراض النساء والتوليد والجمعيه المصريه للتدخل الجراحي الدقيق: وعقدت في الفتره من 12 الي 14 مارس 2023<\\/p>\\r\\n<p>تمت بنجاح كبير ورشه عمل جراحة مناظير بخبرات عالميه على أرض مصريه بمركز المهارات والمحاكاة الطبية تحت مظله جامعه بنها و رعاية معالي الاستاذ الدكتور جمال سوسه رئيس الجامعة و معالي الاستاذ الدكتور ناصر الجيزاوي نائب رئيس الجامعة لشؤندراسات العليا و معالي الاستاذ الدكتور تامر سمير نائب رئيس الجامعة لشؤن التعليم والطلا ب و بمشاركة خبراء عالميين فى مجال المناظير من انجلترا و المانيا بالإضافة لأمهر جراحى المناظير المصريين من مختلف الجامعات (عين شمس &ndash; القاهرة - حلوان &ndash; المنوفيه &ndash; طنطا وجامعة بنها)<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تميزت الورشه بجلسات علميه لتوصيل اساسيات جراحة المناظير على أسس علمية و بطريقه سليمه للمشتركين و طرح الاخطاء في فيديوهات بدلا من التركيز على الشغل المثالي<\\/p>\\r\\n<p><\\/p>\\r\\n<p>اليوم الثالث تم بنجاح اجراء ثلاث عمليات استئصال كامل للرحم بالمنظار لحالات معقدة (مريضة بها اورام ليفية تم استئصال كامل للرحم بالمنظار بنجاح لها واخري استئصال كيس علي المبيض بالمنظار بالاضافة الي استئصال كامل للرحم بالمنظار وثالثة تضخم بالرحم تم استئصال الرحم بالمنظار) والعمليات تمت والحمد لله بدون اي مضاعفات في العمليات المجمعة بمستشفيات بنها الجامعية<\\/p>\\r\\n<p><\\/p>\\r\\n<p>وتم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p>حضر الورشه 150 طبيب متخصص فى مجال النساء و التوليد ( حضور علمى) و تم تدريب 58 طبيب ( المسجلين للتدريب العملى)<\\/p>\\r\\n<p><\\/p>\\r\\n<p><\\/p>\\r\\n<p>الاربعاء في يومي الانعاش القلبى الرئوى بالإضافة إلى المهارات الجراحية الأساسية الدعم الاساسي للحياة القلبيه و ورشه عمل -3 2023 اغسطس 24و 23 والخميس<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسية والتي استهدفت طلاب كليه الطب البشري (ماقبل مرحله البكالوريوس)<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني كانت هناك جلسات علميه لتوصيل اساسيات الجراحة العامه تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للطرق والفنون الجراحيه وكيفيه عمل الغرز الجراحيه عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه تبعها محاضره عن كيفية التعامل النفسى مع المرضى و تنمية مهارات التواصل و ذلك فى محاضره رائعه اشرف عليها مدرس بقسم الامراض النفسيه والعصبيه بكليه طب بنها<\\/p>\\r\\n<p><\\/p>\\r\\n<p>وتميزت الورشه بالاتي:<\\/p>\\r\\n<p>1- محتوي الورشه والدمج بين الانعاش القلب الرئوي والمهارات الجراحية الاساسيه وجزء ثالث في غايه الاهميه وهو الجانب النفسي في تعامل الطبيب حديث التخرج مع المريض وهذا يحدث لاول مرة في جامعة بنها<\\/p>\\r\\n<p>(Doctor Patient Relationship)<\\/p>\\r\\n<p>مما يعطي بعد شامل ومتكامل للتدريب الطبي واقصي استفادة للمتدربين<\\/p>\\r\\n<p>2- حضور طلبه طب وافدين من العراق وفلسطين وسوريا والسودان بالاضافة للطلاب المصريين من كليه طب بنها ومن كليات الطب في الجامعات الخاصة ومن كليه طب العلمين<\\/p>\\r\\n<p>3- تدريب مهني للانعاش القلبي الرئوي عالي الجوده من فريق العمل من قسم طب و رعايه الحالات الحرجه بمستشفى بنها الجامعى وعلي راسهم رئيس القسم ومن فريق الجراحة العامة للتدريب علي اساسيات الجراحة العامه<\\/p>\\r\\n<p>4- استخدام احدث موديلات محاكاه طبيه للمرضي و هى إحدى أهم مميزات مركز المهارات و المحاكاه الطبيه بجامعه بنها حيث صمم المركز خصيصا لهذا الغرض و تم تجهيزه طبقا للمواصفات العالميه فى مجال التدريب الطبى<\\/p>\\r\\n<p>5- اول ورشه عمل يتم تنظيمها علي هذا النسق بكليه طب بنها وجامعة بنها حيث كانت هناك طفره في التدريب على احدث اجهزه المحاكاة الطبية وهذا يتفق مع رؤية المركز<\\/p>\\r\\n<p>6- تم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p><\\/p>\\r\\n<p>الاثنين في يومي الانعاش القلبى الرئوى بالإضافة إلى المهارات الجراحية الأساسية الدعم الاساسي للحياة القلبيه و ورشه عمل -4 2023 اكتوبر 17و 16 والثلاثاء<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح الطب كليه والتي استهدفت طلاب باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسية)2+5البشري (ماقبل مرحله الامتياز) اول دفعه طب بشري النظام الجديد (<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني كانت هناك جلسات علميه لتوصيل اساسيات الجراحة العامه تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للطرق والفنون الجراحيه وكيفيه عمل الغرز الجراحيه عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه تبعها محاضره عن كيفية التعامل النفسى مع المرضى و تنمية مهارات التواصل و ذلك فى محاضره رائعه اشرف عليها مدرس بقسم الامراض النفسيه والعصبيه بكليه طب بنها<\\/p>\\r\\n<p><\\/p>\\r\\n<p>:الورشه بالاتيوتميزت<\\/p>\\r\\n<p>1- محتوي الورشه والدمج بين الانعاش القلب الرئوي والمهارات الجراحية الاساسيه وجزء ثالث في غايه الاهميه وهو الجانب النفسي في تعامل الطبيب حديث التخرج مع المريض وهذا يحدث لاول مرة في جامعة بنها<\\/p>\\r\\n<p>(Doctor Patient Relationship)<\\/p>\\r\\n<p>مما يعطي بعد شامل ومتكامل للتدريب الطبي واقصي استفادة للمتدربين<\\/p>\\r\\n<p>2- حضور طلبه من كليه طب بنها ومن كليات الطب في الجامعات الخاصة<\\/p>\\r\\n<p>3- تدريب مهني للانعاش القلبي الرئوي عالي الجوده من فريق العمل من قسم طب و رعايه الحالات الحرجه بمستشفى بنها الجامعى وعلي راسهم رئيس القسم ومن فريق الجراحة العامة للتدريب علي اساسيات الجراحة العامه<\\/p>\\r\\n<p>4- استخدام احدث موديلات محاكاه طبيه للمرضي و هى إحدى أهم مميزات مركز المهارات و المحاكاه الطبيه بجامعه بنها حيث صمم المركز خصيصا لهذا الغرض و تم تجهيزه طبقا للمواصفات العالميه فى مجال التدريب الطبى<\\/p>\\r\\n<p>5- اول ورشه عمل يتم تنظيمها علي هذا النسق بكليه طب بنها وجامعة بنها للنظام الجديد (5+2) حيث كانت هناك طفره في التدريب على احدث اجهزه المحاكاة الطبية وهذا يتفق مع رؤية المركز<\\/p>\\r\\n<p>6- تم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p>7- كان من المتوقع حضور 20 طبيب ( للتسجيل للتدريب العملى) ولكن كان هناك حضور اكبر من المتوقع حيث تم تدريب 22 طبيب ( المسجلين للتدريب العملى)<\\/p>\\r\\n<p><\\/p>\\r\\n<p><\\/p>\\r\\n<p>في واعادة تاهيل المريض ما بعد توقف القلب واستعادته الانعاش القلبى الرئوى الدعم الاساسي للحياة القلبيه و ورشه عمل -5 2023 اغسطس 8و 7 الاثنين والثلاثاء يومي<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح كليهوالتي استهدفت طلاب باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسيةالعلاج الطبيعي<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني تم تدريب المشتركين علي دور العلاج الطبيعي للتعافي فترة ما بعد توقف القلب واستعادته مره اخري مع مشاركه من فيرق عمل متميز من كليه العلاج الطبيعي وعلي راسهم عميد الكليه<\\/p>\\r\\n<p>Rehabilitation after cardiac arrest<\\/p>\\r\\n<p><\\/p>\\r\\n<p>:الورشه بالاتيوتميزت<\\/p>\\r\\n<p><\\/p>\\r\\n<p>1- تدريب مهني للانعاش القلبي الرئوي عالي الجوده من فريق العمل من قسم طب و رعايه الحالات الحرجه بمستشفى بنها الجامعى وعلي راسهم رئيس القسم ومن فريق الجراحة العامة للتدريب علي اساسيات الجراحة العامه<\\/p>\\r\\n<p>2- استخدام احدث موديلات محاكاه طبيه للمرضي و هى إحدى أهم مميزات مركز المهارات و المحاكاه الطبيه بجامعه بنها حيث صمم المركز خصيصا لهذا الغرض و تم تجهيزه طبقا للمواصفات العالميه فى مجال التدريب الطبى<\\/p>\\r\\n<p>3- اول ورشه عمل يتم تنظيمها علي هذا النسق بكليه العلاج الطبيعي وجامعة بنها حيث كانت هناك طفره في التدريب على احدث اجهزه المحاكاة الطبية وهذا يتفق مع رؤية المركز<\\/p>\\r\\n<p>4- تم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p><\\/p>\\r\\n<p>الاحد في يومي الانعاش القلبى الرئوى بالإضافة إلى المهارات الجراحية الأساسية الدعم الاساسي للحياة القلبيه و ورشه عمل -6<\\/p>\\r\\n<p>2024 فبراير 5و 4 والاثنين<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح كليات والتي استهدفت طلاب باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسية يالطبالقطاع<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني كانت هناك جلسات علميه لتوصيل اساسيات الجراحة العامه تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للطرق والفنون الجراحيه وكيفيه عمل الغرز الجراحيه عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه تبعها محاضرة علي دور العلاج الطبيعي للتعافي فترة ما بعد توقف القلب واستعادته مره اخري مع مشاركه من فيرق عمل متميز من كليه العلاج الطبيعي وعلي راسهم عميد الكليه<\\/p>\\r\\n<p><\\/p>\\r\\n<p>8و 7و 6 والاربعاء والخميس الثلاثاءايام ورشه عمل عن التدريب علي اساسيات رسم القلب و فسيولوجيا القلب في -7 2024 فبراير<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تحت رعايه معالي الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس الجامعه و الاستاذ الدكتور \\/ تامر سمير نائب رئيس الجامعة اختتمت بنجاح باهر فعاليات ورشه عمل عن التدريب علي اساسيات رسم القلب و فسيولوجيا القلب بمركز المهارات والمحاكاة الطبية بالجامعة بالتعاون مع كليه الطب البشري و التى يشرف على التدريب فيها كوكبة من أعضاء هيئة التدريس من قسم امراض القلب والاوعية الدموية بجامعة بنها وذلك<\\/p>\\r\\n<p>والتي استهدفت طلاب الامتياز ونواب الحالات الحرجه وطب الطوارىء وطب الاسره والطب الرياضى وبعض اقسام الباطنه الخاصه الاخرى<\\/p>\\r\\n<p>والتي انعقدت فعاليتها ايام الثلاثاء والاربعاء والخميس 6- 7- 8 فبراير 2024<\\/p>\\r\\n<p><\\/p>\\r\\n<p>و تميزت ورشه العمل بالآتى<\\/p>\\r\\n<p>= محتوى الورشه و الدمج بين الجلسات العلميه التفاعليه والتدريب العملي عن طريق استخدام أجهزة محاكاة عالية التقنية و مزودة بسناريوهات اكلينيكيه لمحتلف امراض القلب و تحاكي البشر بقدر الاستطاعة علي توليد مخطط كهربائي للقلب (ECG) وأصوات القلب المختلفة مما يضمن تدريب شباب الاطباء على الخبرات الطبية التي سيواجهونها وتساعد على توسيع نطاق مهاراتهم وعمقها<\\/p>\\r\\n<p>من خلال توفير بيئة آمنة ، حيث تتاح لهم الفرصة للوصول إلى الإتقان. مما يعطى بعد شامل و متكامل للتدريب الطبى و هذا يضمن جوده عاليه للتدريب و أقصى استفادة للمتدربين<\\/p>\\r\\n<p>= قاعات التدريب التى يمتلكها مركز المهارات و التى تتيح التدريب عن طريق مجموعات صغيرة و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>= الشهادات المعتمده من جامعه بنها التى يحصل عليها المتدربين و تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\"}', 0, '2024-09-05 06:34:48', '2024-09-05 06:39:04'),
(65, 'simulation', '{\"en\":\"What is simulation?\",\"ar\":\"ما هى المحاكاة؟\"}', '{\"en\":\"<p>Under construction<\\/p>\",\"ar\":\"<p>المحاكاة هي استراتيجية تعليمية تسمح بالأداء التفاعلي للمتدرب في بيئة تعيد إنشاء أو تكرار سيناريو إكلينيكي في العالم الحقيقي.<\\/p>\\r\\n<p>تم استخدام المحاكاة وهي راسخة حاليًا في العديد من الصناعات الأخرى بما في ذلك الطيران والملاحة الفضائية والتطبيقات العسكرية<\\/p>\\r\\n<p>استخدام المحاكاة في هذه الصناعات يسبق استخدامها في الجراحة ومثال ذلك المحاكاة في الطيران التي يعود تاريخها إلى خمسينيات القرن الماضي و يجب أن يخضع الطيارون لتدريبات وشهادات شاملة على أجهزة محاكاة الطيران قبل السماح لهم بقيادة الطائرة.<\\/p>\\r\\n<p>وقد أدت التطورات التكنولوجية إلى تطوير مثل هذه النماذج التي تحاكي البشر بقدر استطاعتهم التنفس ،<\\/p>\\r\\n<p>توليد مخطط كهربائي للقلب, اصوات القلب المختلفة والنبض واصوات مجري الهواء ومحاكيات الولادة الطبيعية<\\/p>\\r\\n<p>علاوة على ذلك ، فإن الطريقة التي تمارسها ستعطي نتيجة يمكن التنبؤ بها و يمكن أن تتكرر عدة مرات وسوف تعطي نفس الرد.<\\/p>\\r\\n<p>تتضمن المحاكاة تدريب مقدمي الرعاية الصحية على الخبرات التي سيواجهونها في العالم الحقيقي - وتساعد على توسيع نطاق مهاراتهم وعمقها من خلال توفير بيئة آمنة ، حيث تتاح لهم الفرصة للوصول إلى الإتقان.<\\/p>\\r\\n<p><\\/p>\\r\\n<p>يالجراح ي ومجال الطبالالحاجة إلى المحاكاة في<\\/p>\\r\\n<p>- ربما تكون إحدى القوى الدافعة الأكثر إلحاحًا لدمج المحاكاة في التدريب الطبي و الجراحي هي الحتمية الأخلاقية لتزويد المرضى بأفضل رعاية.<\\/p>\\r\\n<p>لا ينبغي أن يتعرض المرضى لاحتمال الضرر عند توفر طرق تدريب أخرى لاكتساب المهارات. -<\\/p>\\r\\n<p>- تضمن المحاكاة حدوث بعض الممارسات قبل أن يعالج المتدربون مرضى حقيقيين.<\\/p>\\r\\n<p>- ويمكن أن توفر المحاكاة أيضًا وسيلة لكل من الاطباء المقيمين والجراحين في الممارسة العملية لاكتساب المهارات اللازمة لدمج التقنيات الجراحية الجديدة و الابتكار في ذخيرتهم الجراحية ، مع التحول الناتج في منحنى التعلم بعيدًا عن المريض.<\\/p>\\r\\n<p>- تتيح المحاكاة مساحة للخطأ والقدرة على السماح للمتدربين بمعرفة عواقب الخطأ لأنه يمكن أداء المهام غير الصحيحة حتى الانتهاء وبالتالي يكون أداء الفريق بشكل أفضل عند حدوث الأزمات.<\\/p>\\r\\n<p>- غالبًا ما تتضمن مهارات التدريب الحالية استخدام أجهزة محاكاة عالية التقنية تكرر عن كثب الأمراض والظروف التي يواجهها الأطباء في العالم الحقيقي.<\\/p>\\r\\n<p>- بالنسبة للمرضى ، يعزز التدريب على المحاكاة جودة وسلامة الرعاية التي يتلقونها حيث يكون مقدمو الرعاية أكثر استعدادًا وأكثر كفاءة خلال سنوات تدريبهم ومع دخولهم الممارسة.<\\/p>\\r\\n<p>- من خلال المحاكاة ، يتعرض المتعلمون لجوانب متعددة من رعاية المرضى ، مما يمنحهم فرصة لممارسة المهارات السريرية والسلوكية ، بما في ذلك:<\\/p>\\r\\n<p>- التفكير السريري واتخاذ القرار<\\/p>\\r\\n<p>العمل الجماعي الفعال بين المهنيين-<\\/p>\\r\\n<p>- حل الأزمات الطبية<\\/p>\\r\\n<p>بالإضافة إلى ذلك ، فإن تعلم المهارات الجراحية على شخص حي يمكن أن يكون له مشكلات طبية وقانونية وأخلاقية.<\\/p>\\r\\n<p>أدى استخدام المحاكاة إلى تحويل تعلم المهارات الجراحية الأساسية من غرفة العمليات إلى المختبر لممارسة المهارات الجراحية وصقله<\\/p>\"}', 0, '2024-09-05 07:55:51', '2024-09-05 08:09:42');
