(1, '90409_1714484992.jpg', '{\"en\":\"Falling Walls Lab 2023 Cairo is calling all students and early-career professionals to showcase their innovative idea.\",\"ar\":\"fff\"}', '{\"en\":\"Last Year’s Falling Wall Lab took place at the DAAD-Regional Office Cairo. Out of a total of 7 ideas that have been presented by our “Labsters” during the event, Mr Moustafa Abdelwahap managed to win the jury for his innovation of “Breaking the Wall of Artificial Intelligence in Health”. Moustafa problematised the lack of reliable labelled patient data in medical institutions.\",\"ar\":\"fffffffff\"}', '2024-04-17', '{\"en\":\"Last Year’s Falling Wall Lab took place at the DAAD-Regional Office Cairo. Out of a total of 7 ideas that have been presented by our “Labsters” during the event, Mr Moustafa Abdelwahap managed to win the jury for his innovation of “Breaking the Wall of Artificial Intelligence in Health”. Moustafa problematised the lack of reliable labelled patient data in medical institutions.\",\"ar\":\"fffff\"}', '{\"en\":null,\"ar\":null}', NULL, 1, '{\"en\":null,\"ar\":null}', '2024-04-06 09:33:48', '2024-04-30 10:49:52'),
(2, '15117_1714485074.jpg', '{\"en\":\"New Year\",\"ar\":\"r\"}', '{\"en\":\"May your holidays be filled with peace and joy. Warmest wishes for a happy holiday season and prosperous new year.\",\"ar\":\"v\"}', '2024-04-03', '{\"en\":null,\"ar\":null}', '{\"en\":null,\"ar\":null}', NULL, 1, '{\"en\":null,\"ar\":null}', '2024-04-06 09:52:35', '2024-04-30 10:51:15');
