INSERT INTO `workshop` (`id`, `title`, `description`, `created_at`, `updated_at`) VALUES
(1, '{\"en\":\"Workshop on (New developments in ultrasound and Dweller in the field of obstetrics and gynecology) on Tuesday and Wednesday (4-5) September 2023\",\"ar\":\"ورشه عمل عن (الجديد في الموجات فوق الصونية والدويلر في مجال امراض النساء والتوليد) يومي الثلاثاء والاربعاء (4 – 5) سبتمبر 2023\"}', '{\"en\":\"<p><span>Under construction<\\/span><\\/p>\",\"ar\":\"<p>تمت بنجاح كبير ورشه عمل عن (الجديد في الموجات فوق الصونية والدويلر في مجال امراض النساء والتوليد) بمركز المهارات والمحاكاة الطبية بالتعاون مع قسم أمراض النساء و التوليد بجامعه بنها تحت مظله جامعه بنها و رعاية معالي الاستاذ الدكتور ناصر الجيزاوي رئيس الجامعة و معالي الاستاذ الدكتور تامر سمير نائب رئيس الجامعة لشؤن التعليم والطلا ب و بمشاركة خبراء وقامات فى مجال الموجات فوق الصوتيه والدوبلر من الجامعات المصريه المختلفة (جامعة القاهرة - جامعة الازهر &ndash; جامعة المنصورة &ndash; جامعة الزقازيق &ndash; جامعة المنوفيه &ndash; جامعة مصر للعلوم والتكنولوجيا) بالضافة لخبراء وقامات فى مجال الموجات فوق الصوتيه والدوبلر من جامعة بنها و التى استهدفت أطباء النساء و التوليد ( نواب _ دراسات عليا_ زمالة مصري<\\/p>\\r\\n<p><\\/p>\\r\\n<p>و ذلك فى حضور الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنهفي اليوم الاول و الاستاذ الدكتور\\/ تامر سمير نائب رئيس جامعة لشؤن التعليم والطلا ب في اليوم الثاني<\\/p>\\r\\n<p>و تميزت ورشه العمل بالآتى<\\/p>\\r\\n<p>فريق عمل و تدريب على أعلى مستوى<\\/p>\\r\\n<p>احدث اجهزه السونار من الفئات العالية و التى وفرها قسم امراض النساء و التوليد و مركز المهارات و المحاكاه الطبيه بجامعه بنها بالتعاون مع شركة ميندراى الرائده فى مجال السونار وذلك ليتيح للمشتركين التدرب على احدث التقنيات الطبية فى مجال السونار و ضمانا لجوده عاليه من التدريب<\\/p>\\r\\n<p><\\/p>\\r\\n<p>و تم التدريب على المرضي ( بعد اخد موافقة من المرضي) مما يعطى بعد شامل لمفهوم التدريب الطبى و يضمن للمشترك تحقيق الاستفادة القصوى<\\/p>\\r\\n<p>التى يمتلكها مركز المهارات و التى تتيح التدريب عن طريق للمجموعات الصغيره قاعات التدريب<\\/p>\\r\\n<p>Small group Learning<\\/p>\\r\\n<p>و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>الشهادات المعتمده من جامعه بنها التى يحصل عليها المتدربين و تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p>حضر الورشه 80 طبيب متخصص فى مجال النساء و التوليد ( حضور علمى) و تم تدريب 35 طبيب ( المسجلين للتدريب العملى)<\\/p>\"}', '2024-09-29 09:30:02', '2024-09-30 05:46:19'),
(2, '{\"en\":\"Workshop on the latest developments in gynecological laparoscopic surgery in cooperation with the Department of Obstetrics and Gynecology and the Egyptian Society for Minimally Invasive Surgery: It was held from March 12 to 14, 2023.\",\"ar\":\"ورشه عمل عن الجديد في جراحه المناظير النسائيه بالتعاون مع قسم امراض النساء والتوليد والجمعيه المصريه للتدخل الجراحي الدقيق: وعقدت في الفتره من 12 الي 14 مارس 2023\"}', '{\"en\":\"<p><span>Under construction<\\/span><\\/p>\",\"ar\":\"<p>تمت بنجاح كبير ورشه عمل جراحة مناظير بخبرات عالميه على أرض مصريه بمركز المهارات والمحاكاة الطبية تحت مظله جامعه بنها و رعاية معالي الاستاذ الدكتور جمال سوسه رئيس الجامعة و معالي الاستاذ الدكتور ناصر الجيزاوي نائب رئيس الجامعة لشؤندراسات العليا و معالي الاستاذ الدكتور تامر سمير نائب رئيس الجامعة لشؤن التعليم والطلا ب و بمشاركة خبراء عالميين فى مجال المناظير من انجلترا و المانيا بالإضافة لأمهر جراحى المناظير المصريين من مختلف الجامعات (عين شمس &ndash; القاهرة - حلوان &ndash; المنوفيه &ndash; طنطا وجامعة بنها)<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تميزت الورشه بجلسات علميه لتوصيل اساسيات جراحة المناظير على أسس علمية و بطريقه سليمه للمشتركين و طرح الاخطاء في فيديوهات بدلا من التركيز على الشغل المثالي<\\/p>\\r\\n<p><\\/p>\\r\\n<p>اليوم الثالث تم بنجاح اجراء ثلاث عمليات استئصال كامل للرحم بالمنظار لحالات معقدة (مريضة بها اورام ليفية تم استئصال كامل للرحم بالمنظار بنجاح لها واخري استئصال كيس علي المبيض بالمنظار بالاضافة الي استئصال كامل للرحم بالمنظار وثالثة تضخم بالرحم تم استئصال الرحم بالمنظار) والعمليات تمت والحمد لله بدون اي مضاعفات في العمليات المجمعة بمستشفيات بنها الجامعية<\\/p>\\r\\n<p><\\/p>\\r\\n<p>وتم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p>حضر الورشه 150 طبيب متخصص فى مجال النساء و التوليد ( حضور علمى) و تم تدريب 58 طبيب ( المسجلين للتدريب العملى)<\\/p>\"}', '2024-09-30 04:59:53', '2024-09-30 04:59:53'),
(3, '{\"en\":\"Basic Life Support and CPR Workshop in addition to Basic Surgical Skills on Wednesday and Thursday, August 23 and 24, 2023\",\"ar\":\"ورشه عمل الدعم االساسي للحياة القلبيه و االنعاش القلبى الرئوى باإلضافة إلى المهارات الجراحية األساسية في يومي االربعاء\\r\\nوالخميس 23 و 24 اغسطس 2023\"}', '{\"en\":\"<p><span>Under construction<\\/span><\\/p>\",\"ar\":\"<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسية والتي استهدفت طلاب كليه الطب البشري (ماقبل مرحله البكالوريوس)<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني كانت هناك جلسات علميه لتوصيل اساسيات الجراحة العامه تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للطرق والفنون الجراحيه وكيفيه عمل الغرز الجراحيه عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه تبعها محاضره عن كيفية التعامل النفسى مع المرضى و تنمية مهارات التواصل و ذلك فى محاضره رائعه اشرف عليها مدرس بقسم الامراض النفسيه والعصبيه بكليه طب بنها<\\/p>\\r\\n<p><\\/p>\\r\\n<p>وتميزت الورشه بالاتي:<\\/p>\\r\\n<p>1- محتوي الورشه والدمج بين الانعاش القلب الرئوي والمهارات الجراحية الاساسيه وجزء ثالث في غايه الاهميه وهو الجانب النفسي في تعامل الطبيب حديث التخرج مع المريض وهذا يحدث لاول مرة في جامعة بنها<\\/p>\\r\\n<p>(Doctor Patient Relationship)<\\/p>\\r\\n<p>مما يعطي بعد شامل ومتكامل للتدريب الطبي واقصي استفادة للمتدربين<\\/p>\\r\\n<p>2- حضور طلبه طب وافدين من العراق وفلسطين وسوريا والسودان بالاضافة للطلاب المصريين من كليه طب بنها ومن كليات الطب في الجامعات الخاصة ومن كليه طب العلمين<\\/p>\\r\\n<p>3- تدريب مهني للانعاش القلبي الرئوي عالي الجوده من فريق العمل من قسم طب و رعايه الحالات الحرجه بمستشفى بنها الجامعى وعلي راسهم رئيس القسم ومن فريق الجراحة العامة للتدريب علي اساسيات الجراحة العامه<\\/p>\\r\\n<p>4- استخدام احدث موديلات محاكاه طبيه للمرضي و هى إحدى أهم مميزات مركز المهارات و المحاكاه الطبيه بجامعه بنها حيث صمم المركز خصيصا لهذا الغرض و تم تجهيزه طبقا للمواصفات العالميه فى مجال التدريب الطبى<\\/p>\\r\\n<p>5- اول ورشه عمل يتم تنظيمها علي هذا النسق بكليه طب بنها وجامعة بنها حيث كانت هناك طفره في التدريب على احدث اجهزه المحاكاة الطبية وهذا يتفق مع رؤية المركز<\\/p>\\r\\n<p>6- تم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\"}', '2024-09-30 04:59:53', '2024-09-30 05:05:46'),
(4, '{\"en\":\"Basic Cardiac Life Support and CPR Workshop in addition to Basic Surgical Skills on Monday and Tuesday, October 16 and 17, 2023\",\"ar\":\"ورشه عمل الدعم االساسي للحياة القلبيه و الإنعاش القلبى الرئوى باإلضافة إلى المهارات الجراحية الأساسية في يومي الإثنين\\r\\nوالثلاثاء 16 و 17 اكتوبر 2023\"}', '{\"en\":\"<p><span>Under construction<\\/span><\\/p>\",\"ar\":\"<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح الطب كليه والتي استهدفت طلاب باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسية)2+5البشري (ماقبل مرحله الامتياز) اول دفعه طب بشري النظام الجديد (<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني كانت هناك جلسات علميه لتوصيل اساسيات الجراحة العامه تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للطرق والفنون الجراحيه وكيفيه عمل الغرز الجراحيه عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه تبعها محاضره عن كيفية التعامل النفسى مع المرضى و تنمية مهارات التواصل و ذلك فى محاضره رائعه اشرف عليها مدرس بقسم الامراض النفسيه والعصبيه بكليه طب بنها<\\/p>\\r\\n<p><\\/p>\\r\\n<p>:الورشه بالاتيوتميزت<\\/p>\\r\\n<p>1- محتوي الورشه والدمج بين الانعاش القلب الرئوي والمهارات الجراحية الاساسيه وجزء ثالث في غايه الاهميه وهو الجانب النفسي في تعامل الطبيب حديث التخرج مع المريض وهذا يحدث لاول مرة في جامعة بنها<\\/p>\\r\\n<p>(Doctor Patient Relationship)<\\/p>\\r\\n<p>مما يعطي بعد شامل ومتكامل للتدريب الطبي واقصي استفادة للمتدربين<\\/p>\\r\\n<p>2- حضور طلبه من كليه طب بنها ومن كليات الطب في الجامعات الخاصة<\\/p>\\r\\n<p>3- تدريب مهني للانعاش القلبي الرئوي عالي الجوده من فريق العمل من قسم طب و رعايه الحالات الحرجه بمستشفى بنها الجامعى وعلي راسهم رئيس القسم ومن فريق الجراحة العامة للتدريب علي اساسيات الجراحة العامه<\\/p>\\r\\n<p>4- استخدام احدث موديلات محاكاه طبيه للمرضي و هى إحدى أهم مميزات مركز المهارات و المحاكاه الطبيه بجامعه بنها حيث صمم المركز خصيصا لهذا الغرض و تم تجهيزه طبقا للمواصفات العالميه فى مجال التدريب الطبى<\\/p>\\r\\n<p>5- اول ورشه عمل يتم تنظيمها علي هذا النسق بكليه طب بنها وجامعة بنها للنظام الجديد (5+2) حيث كانت هناك طفره في التدريب على احدث اجهزه المحاكاة الطبية وهذا يتفق مع رؤية المركز<\\/p>\\r\\n<p>6- تم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\\r\\n<p>7- كان من المتوقع حضور 20 طبيب ( للتسجيل للتدريب العملى) ولكن كان هناك حضور اكبر من المتوقع حيث تم تدريب 22 طبيب ( المسجلين للتدريب العملى)<\\/p>\"}', '2024-09-30 05:12:50', '2024-09-30 05:12:50'),
(5, '{\"en\":\"Basic Life Support, CPR, Post-Cardiac Arrest Rehabilitation and Recovery Workshop on Monday and Tuesday, August 7 and 8, 2023\",\"ar\":\"ورشه عمل الدعم االساسي للحياة القلبيه و الإنعاش القلبى الرئوى واعادة تاهيل المريض ما بعد توقف القلب واستعادته في\\r\\nيومي االثنين والثلاثاء 7 و 8 اغسطس 2023\"}', '{\"en\":\"<p><span>Under construction<\\/span><\\/p>\",\"ar\":\"<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح كليهوالتي استهدفت طلاب باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسيةالعلاج الطبيعي<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني تم تدريب المشتركين علي دور العلاج الطبيعي للتعافي فترة ما بعد توقف القلب واستعادته مره اخري مع مشاركه من فيرق عمل متميز من كليه العلاج الطبيعي وعلي راسهم عميد الكليه<\\/p>\\r\\n<p>Rehabilitation after cardiac arrest<\\/p>\\r\\n<p><\\/p>\\r\\n<p>:الورشه بالاتيوتميزت<\\/p>\\r\\n<p><\\/p>\\r\\n<p>1- تدريب مهني للانعاش القلبي الرئوي عالي الجوده من فريق العمل من قسم طب و رعايه الحالات الحرجه بمستشفى بنها الجامعى وعلي راسهم رئيس القسم ومن فريق الجراحة العامة للتدريب علي اساسيات الجراحة العامه<\\/p>\\r\\n<p>2- استخدام احدث موديلات محاكاه طبيه للمرضي و هى إحدى أهم مميزات مركز المهارات و المحاكاه الطبيه بجامعه بنها حيث صمم المركز خصيصا لهذا الغرض و تم تجهيزه طبقا للمواصفات العالميه فى مجال التدريب الطبى<\\/p>\\r\\n<p>3- اول ورشه عمل يتم تنظيمها علي هذا النسق بكليه العلاج الطبيعي وجامعة بنها حيث كانت هناك طفره في التدريب على احدث اجهزه المحاكاة الطبية وهذا يتفق مع رؤية المركز<\\/p>\\r\\n<p>4- تم تسليم لشهادات معتمده من جامعه بنها للمتدربين وهي تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\"}', '2024-09-30 05:16:36', '2024-09-30 05:16:36'),
(6, '{\"en\":\"Basic Life Support and CPR Workshop in addition to Basic Surgical Skills on Sunday and Monday 4th and 5th February 2024\",\"ar\":\"ورشه عمل الدعم االساسي للحياة القلبيه و االنعاش القلبى الرئوى باإلضافة إلى المهارات الجراحية الأساسية في يومي الأحد\\r\\nوالإثنين 4 و 5 فبراير 2024\"}', '{\"en\":\"<p><span>Under construction<\\/span><\\/p>\",\"ar\":\"<p>تحت رعاية الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس جامعه بنها و الاستاذ الدكتور \\/ تامر سمير نائب رئيس جامعة بنها اختتمت بنجاح كليات والتي استهدفت طلاب باهر فعاليات ورشه عمل الانعاش القلبى الرئوى الأساسية بالإضافة إلى المهارات الجراحية الأساسية يالطبالقطاع<\\/p>\\r\\n<p>في اليوم الاول تميزت الورشه بجلسات علميه لتوصيل اساسيات دعم الحياة القلبيه و الانعاش القلبى الرئوى تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للانعاش القلبي الرئوي عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>وفي اليوم الثاني كانت هناك جلسات علميه لتوصيل اساسيات الجراحة العامه تبعها تدريب للطلاب على احدث اجهزه المحاكاة الطبية بمركز المهارات والمحاكاة للطرق والفنون الجراحيه وكيفيه عمل الغرز الجراحيه عن طريق مجموعات صغيره للتدريب و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه تبعها محاضرة علي دور العلاج الطبيعي للتعافي فترة ما بعد توقف القلب واستعادته مره اخري مع مشاركه من فيرق عمل متميز من كليه العلاج الطبيعي وعلي راسهم عميد الكليه<\\/p>\\r\\n<p><\\/p>\\r\\n<p>8و 7و 6 والاربعاء والخميس الثلاثاءايام ورشه عمل عن التدريب علي اساسيات رسم القلب و فسيولوجيا القلب في -7 2024 فبراير<\\/p>\\r\\n<p><\\/p>\\r\\n<p>تحت رعايه معالي الاستاذ الدكتور\\/ ناصر الجيزاوي رئيس الجامعه و الاستاذ الدكتور \\/ تامر سمير نائب رئيس الجامعة اختتمت بنجاح باهر فعاليات ورشه عمل عن التدريب علي اساسيات رسم القلب و فسيولوجيا القلب بمركز المهارات والمحاكاة الطبية بالجامعة بالتعاون مع كليه الطب البشري و التى يشرف على التدريب فيها كوكبة من أعضاء هيئة التدريس من قسم امراض القلب والاوعية الدموية بجامعة بنها وذلك<\\/p>\\r\\n<p>والتي استهدفت طلاب الامتياز ونواب الحالات الحرجه وطب الطوارىء وطب الاسره والطب الرياضى وبعض اقسام الباطنه الخاصه الاخرى<\\/p>\\r\\n<p>والتي انعقدت فعاليتها ايام الثلاثاء والاربعاء والخميس 6- 7- 8 فبراير 2024<\\/p>\\r\\n<p><\\/p>\\r\\n<p>و تميزت ورشه العمل بالآتى<\\/p>\\r\\n<p>= محتوى الورشه و الدمج بين الجلسات العلميه التفاعليه والتدريب العملي عن طريق استخدام أجهزة محاكاة عالية التقنية و مزودة بسناريوهات اكلينيكيه لمحتلف امراض القلب و تحاكي البشر بقدر الاستطاعة علي توليد مخطط كهربائي للقلب (ECG) وأصوات القلب المختلفة مما يضمن تدريب شباب الاطباء على الخبرات الطبية التي سيواجهونها وتساعد على توسيع نطاق مهاراتهم وعمقها<\\/p>\\r\\n<p>من خلال توفير بيئة آمنة ، حيث تتاح لهم الفرصة للوصول إلى الإتقان. مما يعطى بعد شامل و متكامل للتدريب الطبى و هذا يضمن جوده عاليه للتدريب و أقصى استفادة للمتدربين<\\/p>\\r\\n<p>= قاعات التدريب التى يمتلكها مركز المهارات و التى تتيح التدريب عن طريق مجموعات صغيرة و التى تحقق أقصى استفادة للمتدربين حيث يستطيع كل متدرب التطبيق العملى بنفسه<\\/p>\\r\\n<p>= الشهادات المعتمده من جامعه بنها التى يحصل عليها المتدربين و تعتبر جزء أساسى من أسس التدريب الطبى و تضمن لحاملها الاعتراف بها من الهيئات المحلية و الدولية<\\/p>\"}', '2024-09-30 05:19:28', '2024-09-30 05:19:28');
